import React from 'react';
import './TableStyles.css';

const Table = () => {
    const scheduleData = [
        {
            day: 'Monday',
            topic: 'Math',
            time: '10:00 AM',
            meetingType: 'Virtual',
            meetingLink: 'https://example.com/meeting1',
            meetingID: '123-456-789',
            passcode: 'abc123'
        },
        {
            day: 'Tuesday',
            topic: 'Science',
            time: '11:00 AM',
            meetingType: 'Physical'
        },
        {
            day: 'Wednesday',
            topic: 'History',
            time: '12:00 PM',
            meetingType: 'Virtual',
            meetingLink: 'https://example.com/meeting2',
            meetingID: '987-654-321',
            passcode: 'def456'
        },
        {
            day: 'Thursday',
            topic: 'Art',
            time: '1:00 PM',
            meetingType: 'Physical'
        },
        {
            day: 'Friday',
            topic: 'Physical Education',
            time: '2:00 PM',
            meetingType: 'Virtual',
            meetingLink: 'https://example.com/meeting3',
            meetingID: '555-666-777',
            passcode: 'ghi789'
        },
        {
            day: 'Saturday',
            topic: 'Steps and Traditions',
            time: '20:00 West Central Africa',
            meetingType: 'Virtual',
            meetingLink: 'https://zoom.us/j/97199164571?pwd=WGxTQWxOQm9CTWdPbnhmaG9Xb1VtZz09',
            meetingID: '971 9916 4571',
            passcode: ' steps'
        },
        {
            day: 'Sunday',
            topic: 'Literature',
            time: '4:00 PM',
            meetingType: 'Virtual',
            meetingLink: 'https://example.com/meeting4',
            meetingID: '444-333-222',
            passcode: 'jkl012'
            
        }
    ];

    return (
        
        <div className="table-container">
            <table className="schedule-table">
                <thead>
                    <tr>
                        <th>Day of the Week</th>
                        <th>Topic</th>
                        <th>Time</th>
                        <th>Meeting Type</th>
                        <th>Details</th>
                    </tr>
                </thead>
                <tbody>
                    {scheduleData.map((schedule, index) => (
                        <tr key={index}>
                            <td>{schedule.day}</td>
                            <td>{schedule.topic}</td>
                            <td>{schedule.time}</td>
                            <td>{schedule.meetingType}</td>
                            <td>
                                {schedule.meetingType === 'Virtual' ? (
                                    <div>
                                        <p>Link: <a href={schedule.meetingLink} className="link">{schedule.meetingLink}</a></p>
                                        <p>ID: {schedule.meetingID}</p>
                                        <p>Passcode: {schedule.passcode}</p>
                                    </div>
                                ) : (
                                    <p>Physical Meeting</p>
                                )}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Table;
